def convert_haddock_output_to_normal_pdb(pdb_file, chain1, chain2):
    with open(pdb_file,'r') as file:
        x = file.readlines()
    results = ''
    for y in x:
        curr_line = y
        if y.startswith('ATOM'):
            chain = chain1 if y[72] == 'A' else chain2
            l = list(curr_line)
            l[21] = chain
            curr_line = ''.join(l)
        results += curr_line
    with open(pdb_file.replace('.pdb','_modified.pdb'),'w') as file:
        file.write(results)
    return pdb_file.replace('.pdb','_modified.pdb')



def get_dockq_score(dockq_python_file, dockq_example1, dockq_example2):
    output = str(subprocess.check_output(f'{dockq_python_file} {dockq_example1} {dockq_example2}', shell=True))
    dockq_score = float(output.split('DockQ ')[-1].replace(' \\n\'',''))
    return dockq_score

def calc_all_dockq_scores(docking_results, complex_dirs, dockq_python_file):
    all_results = []
    for dir in os.listdir(docking_results):
        print()
        print(dir)
        results = []
        curr_docking_path = docking_results+dir+'/'
        curr_complex_pdb_path = complex_dirs+dir+'/complex_pdb/'
        if os.path.exists(curr_complex_pdb_path):
            curr_complex_pdb_file = None
            for file in os.listdir(curr_complex_pdb_path):
                if file.endswith('.pdb'): curr_complex_pdb_file = curr_complex_pdb_path+file
            if curr_complex_pdb_file is None:
                print(f'WARNING: no complex pdb file for {dir}')
                continue
            chain1 = curr_complex_pdb_file.split('_')[-2]
            chain2 = curr_complex_pdb_file.split('_')[-1].replace('.pdb','')
            for file in os.listdir(curr_docking_path):
                if file.endswith('w.pdb'):
                    curr_docking_file = curr_docking_path+file
                    try:
                        results.append(get_dockq_score(dockq_python_file, convert_haddock_output_to_normal_pdb(curr_docking_file, chain1, chain2),
                                          curr_complex_pdb_file))
                    except:
                        print('WARNING: no docking possible')
        if len(results)>0:
            print(np.mean(results))
            print(results)
            all_results.append([dir, np.mean(results), results])
        print(all_results)
    print(all_results)



def plot_dockq_results(results):
    df = pd.DataFrame(results, columns=['name', 'mean_DockQ_scores', 'dockQ_scores'])
    g = sns.histplot(df, x='mean_DockQ_scores', bins=30, element="step", palette='Set2')
    g.axes.set_yscale('log')
    plt.axvline(0.23, ls='--', linewidth=1)
    plt.axvline(0.49, ls='--', linewidth=1)
    plt.axvline(0.8, ls='--', linewidth=1)
    plt.show()

def plot_dockq_results_of_multiple_iterations(results):
    combined_results = []
    for i,result in enumerate(results):
        result = [xx + [i+1] for xx in result]
        combined_results += result
    df_combined = pd.DataFrame(combined_results, columns=['name', 'mean_DockQ_scores', 'dockQ_scores', 'iteration'])
    g = sns.ecdfplot(df_combined, x='mean_DockQ_scores', hue='iteration', palette='Set2', complementary=True)
    # g.axes.set_yscale('log')
    g.axes.invert_xaxis()
    plt.axvline(0.23, ls='--', linewidth=1)
    plt.axvline(0.49, ls='--', linewidth=1)
    plt.axvline(0.8, ls='--', linewidth=1)
    plt.show()
